import React from "react";
import { StyleSheet } from "react-native";

export const style = StyleSheet.create({
    container: {
        width: 200,
        height: 200,
        backgroundColor: '#152238',
        borderRadius: 10,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center'
    }
})
